import { auth } from '../constants';
import { IAuthClient } from './client';

export declare namespace AuthTokenTypes {
	type RequestParams = {
		redirect_uri: string;
		code_challenge_method: string;
		state?: string;
		code_challenge?: string;
		scope?: string;
		origin?: string;
	};

	type TokenType = {
		accessToken: string;
		refreshToken: string;
		expired: number;
	};
}

export abstract class IAuthToken {
	constructor(public token: auth.TMiraiAccessToken) {}
}
